/*Table structure for table `sys_flow` */

DROP TABLE IF EXISTS `sys_flow`;

CREATE TABLE `sys_flow` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `applyUser` int(11) NOT NULL COMMENT '申请人',
  `handlerUser` int(11) NOT NULL COMMENT '当前处理人',
  `status` int(11) NOT NULL COMMENT '状态：0暂存未开始,1已审核,2未审核,3,本申请已经结束,',
