  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`house_id`)
) ENGINE=InnoDB AUTO_INCREMENT=1026 DEFAULT CHARSET=utf8 COMMENT='楼房基础信息表';

