/*Table structure for table `sys_house_unit` */

DROP TABLE IF EXISTS `sys_house_unit`;

CREATE TABLE `sys_house_unit` (
  `house_unit_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT 'id',
  `unit_code` varchar(30) NOT NULL COMMENT '单元编号',
  `building_Id` varchar(30) NOT NULL COMMENT '所在楼盘ID',
  `house_unit_name` varchar(30) NOT NULL COMMENT '单元名称',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`house_unit_id`)
) ENGINE=InnoDB AUTO_INCREMENT=77 DEFAULT CHARSET=utf8 COMMENT='楼盘单元楼号中间表';

